def clearImagePath():
    try:
        shutil.rmtree(imagePath)
    except:
        pass

def errorMessage(e):
    errorWindow = tk.Toplevel()
    errorWindow.geometry('700x100')
    
    clearImagePath()

    errorText = tk.Text(errorWindow, font = ('Helvetica', '15', 'bold'), width = 64)
    errorText.insert('insert', 'Error at: {}'.format(e))
    errorText['state'] = 'disabled'
    errorText.pack()

def itemError(e):
    itemErrorWindow = tk.Toplevel()
    itemErrorWindow.geometry('700x100')

    clearImagePath()

    itemErrorText = tk.Text(itemErrorWindow, font = ('Helvetica', '15', 'bold'), width = 64)
    itemErrorText.insert('insert', 'Item error at: {}'.format(e) + '\nTo see all valid item keys go to https://www.tinyurl.com/7b7bs4c')
    itemErrorText['state'] = 'disabled'
    itemErrorText.pack()

def instructions():
    pass

def genInfographic():
    dungeonList, dungeonLinkList, itemLists = [], [], []
    length = len(dungeonChoices)
    rows, x, y = 0, 5, 5

    for i in range(length):
        dungeonList.append(dungeonOptions[i].get())

        dungeonLinkList.append(dungeons[dungeonOptions[i].get()])
        
        itemList = []
        item = ''
        text = startTexts[i].get('1.0', 'end')

        for i in text:
            if i == '\n':
                itemList.append(item)
                item = ''
                continue
            else:
                item = item + i
        
        itemLists.append(itemList)

    for i in itemLists:
        rows = rows + ceil(len(i) / 10)

    yaxis = (length * 60) + (rows * 40) + 5

    infographic = tk.Toplevel()
    infographic.geometry('550x{}'.format(yaxis))
    infographic.configure(background='white')
    canvas = tk.Canvas(infographic, width = 550, height = yaxis, bd = 0, highlightthickness = 0)
    canvas.pack()

    bglink = bgEntry.get()

    try:
        os.mkdir(imagePath)
    except:
        clearImagePath()
        os.mkdir(imagePath)

    try: 
        urllib.request.urlretrieve(bglink, imagePath + '\\bg.png')
        bgpath = imagePath + '\\bg.png'
        bgResize = Image.open(bgpath)
        bgResize = bgResize.resize((550, yaxis), Image.ANTIALIAS)
        bgImage = ImageTk.PhotoImage(bgResize)
        canvas.create_image(0, 0, image = bgImage, anchor = 'nw')
    except:
        pass
        
    for i in range(length):
        dungeonpath = imagePath + '\\dungeon' + str(i) + '.png'
        urllib.request.urlretrieve('https:' + dungeonLinkList[i], dungeonpath)
        dungeonResize = Image.open(dungeonpath)
        dungeonImage = ImageTk.PhotoImage(dungeonResize.resize((52, 52), Image.ANTIALIAS))
        garbageLabel = tk.Label(frame, image = dungeonImage) #workaround for tkinter
        garbageLabel.image = dungeonImage #workaround
        canvas.create_image(x, y, image = dungeonImage, anchor = 'nw')

        x+= 60
        y+= 12
        canvas.create_text(x, y, font = ('Chronotype', '30', 'bold'), text = dungeonList[i], anchor = 'nw', fill = 'gray')
        canvas.create_text(x+1, y+2, font = ('Chronotype', '30', 'bold'), text = dungeonList[i], anchor = 'nw')

        x-= 60
        y+= 38
        pathname = str(i)
        images = []
        xChangeCount = 0
        for j in range(len(itemLists[i])):
            try:
                urllib.request.urlretrieve('https:' + items[itemLists[i][j]], imagePath + '\\' + pathname + '.png')
                itemResize = Image.open(imagePath + '\\' + pathname + '.png')
                itemImage = ImageTk.PhotoImage(itemResize.resize((40, 40), Image.ANTIALIAS))
                garbageLabel = tk.Label(frame, image = itemImage) #workaround for tkinter
                garbageLabel.image = itemImage #workaround
                images.append(itemImage)
                pathname = pathname + '0'

            except Exception as e:
                itemError(e)
                break

        for j in images:
            canvas.create_image(x, y, image = j, anchor = 'nw')
            if xChangeCount != 9:
                x+= 40
                xChangeCount+= 1
            else:
                x-= 360
                y+= 40
                xChangeCount = 0
        x = 5
        y+= 50

    canvas.create_text(444, y-1, anchor = 'se', font = ('Chronotype', '15'), text = 'Made by Flaps#9562', fill = 'gray')
    canvas.create_text(445, y, anchor = 'se', font = ('Chronotype', '15'), text = 'Made by Flaps#9562')

    shutil.rmtree(imagePath)

    infographic.mainloop()

def remGraphic():
    index = len(dungeonOptions) - 1

    dungeonOptions.pop()

    dungeonChoices[index].destroy()
    dungeonChoices.pop()

    startTexts[index].destroy()
    startTexts.pop()

    manageWindow()

def addGraphic():
    dungeonOption = tk.StringVar(frame)
    dungeonOption.set('Choose a Dungeon')
    dungeonOptions.append(dungeonOption)

    dungeonChoice = tk.OptionMenu(frame, dungeonOption, *dungeonNames)
    dungeonChoices.append(dungeonChoice)

    startText = tk.Text(frame, font = ('Helvetica', '10'), height = 25)
    startTexts.append(startText)

    manageWindow()

def manageWindow():
    window.geometry('{}x740'.format(len(dungeonOptions)*615) + '-25-150')
    
    length = len(dungeonOptions)

    for i in range(length):
        dungeonChoices[i].grid(column = i*2, row = 1, padx = 50, sticky = 'nsw', pady = 20, columnspan = 2)
        startTexts[i].grid(column = i*2, row = 2, ipadx = 1, padx = 25, sticky = 'nsew', ipady = 100, columnspan = 2)

    startButton.grid(column = 2*(length-1), row = 3, pady = 20, columnspan = 2)
    addButton.grid(column = 2*(length-1), row = 3)
    remButton.grid(column = 2*length-1, row = 3)

    if length == 1:
        remButton.grid_remove()
    elif length == 3:
        addButton.grid_remove()

    frame.grid(row = 1, column = 1)

imagePath = os.getcwd() + '\\RealmInfographicTEMPimages'
dungeonNames = sorted(dungeons.keys())
dungeonChoices, dungeonOptions, startTexts = [], [], []

window = tk.Tk()
window.title('Infographic')
window.configure(background = 'white')

frame = tk.Frame(window)
startButton = tk.Button(frame, text = 'Go!', command = genInfographic, bg = 'sky blue', width = 5)
addButton = tk.Button(frame, text = '+', command = addGraphic, bg = 'sky blue', width = 3)
remButton = tk.Button(frame, text = '-', command = remGraphic, bg = 'sky blue', width = 3)

bgEntry = tk.Entry(frame, font = ('Helvetica', '10'))
bgEntry.insert('end', 'BG Link (empty for white)')
bgEntry.grid(column = 1, row = 1, padx = 50, sticky = 'nsew', pady = 20)

addGraphic()
window.mainloop()

